  float: right;
  height: 1500px;
  right: 0;
  flex-wrap: wrap;
  margin-top: 35px;
`;
////////////////////////////////////////////////////////////////
const ProductDiv = styled.div`
  display: flex;
  flex-direction: column;
  background-color: white;
  justify-content: ;
  width: 250px;
  height: 200px;
  border: 0.1px solid black;
  margin-top: 10px;
  img {
    width: 60%;
    height: 50%;
    left: 0;
    right: 0;
    margin: 15px auto;
  }
`;
